import React, { Component } from 'react'
import * as V from 'victory';
import { VictoryBar, VictoryChart } from 'victory';

const data = [
    {age: 17, population: 4.89},
    {age: 18-24, population: 8.94},
    {age: 25-34, population: 18.27},
    {age: 45-54, population: 16.06}
  ];

export class ChartOne extends Component {
    render() {
        return (
            <div>
                <VictoryChart>
                    <VictoryBar
                        data={data}
                        x="age"
                        y="population"
                    />
                </VictoryChart>
            </div>
        )
    }
}

export default ChartOne
